<meta-information><project-name>EXMARaLDA DemoKorpus</project-name><transcription-name>Rudi Völler: Wutausbruch</transcription-name><referenced-file url="RudiVoellerWutausbruch.mp3" /><referenced-file url="RudiVoellerWutausbruch.wav" /><referenced-file url="RudiVoellerWutausbruch.mpg" /><referenced-file url="RudiVoellerWutausbruch.webm" /><ud-meta-information><ud-information attribute-name="COMA-Transcription-ID">CIDID12754011-89F1-D2B4-2A47-38CC70CA81A4</ud-information><ud-information attribute-name="COMA-Communication-ID">IDF602CEF7-9745-FF6F-2357-6CFD47DFF0ED</ud-information><ud-information attribute-name="t:segmented">false</ud-information><ud-information attribute-name="c:transcription-name">Rudi Völler Wutausbruch</ud-information><ud-information attribute-name="c:project-name">EXMARaLDA DemoKorpus</ud-information><ud-information attribute-name="c:transcription-convention">HIAT (vereinfacht), für Nonverbales projekteigene: Mimik und Gestik der Sprecher werden nur ansatzweise angedeutet. Abkürzungen: LA= linker Arm, RA= rechter Arm, LH= linke Hand, RH= rechte Hand, KO= Kopf, OK= Oberkörper.</ud-information><ud-information attribute-name="c:Gesprächstyp">Fernsehinterview</ud-information><ud-information attribute-name="c:Transkribent">Annette Schnieder</ud-information><ud-information attribute-name="c:Aufnahmedatum">07.09.2003</ud-information><ud-information attribute-name="c:Transkription erstellt im">Januar 2004</ud-information><ud-information attribute-name="c:Vorgeschichte">Das Fußball-EM-Qualifikationsspiels gegen Island endete 0:0. Vor der Live-Schaltung nach Reykjavik haben die Moderatoren der Sportsendung, Gerhard Delling und Günter Netzer, die noch auf einem Monitor im Studio zu sehen sind, das Spiel bzw. die Leistung der deutschen Nationalmannschaft bewertet. </ud-information><ud-information attribute-name="c:Quelle">Sportschau (ARD) am 06.09.2003. Aufgenommen und bereitgestellt von Dr. Wilfried Schütte (Institut für Deutsche Sprache, Mannheim).</ud-information><ud-information attribute-name="c:folder">Rudi</ud-information><ud-information attribute-name="Code">Rudi_Voeller_Wutausbruch</ud-information><ud-information attribute-name="# EXB-SOURCE">RudiVoellerWutausbruch.exb</ud-information><ud-information attribute-name="# HIAT:ip">795</ud-information><ud-information attribute-name="# HIAT:w">551</ud-information><ud-information attribute-name="# e">187</ud-information><ud-information attribute-name="# HIAT:non-pho">62</ud-information><ud-information attribute-name="# HIAT:u">73</ud-information><ud-information attribute-name="# sc">38</ud-information></ud-meta-information><comment>Bei dem transkribierten Video handelt es sich um einen Ausschnitt aus einer Sportreportage der ARD anlässlich des Fußball-EM-Qualifikationsspiels Island - Deutschland in Reykjavik am 6. September 2003. Das Spiel endete 0:0. Die Moderatoren der Sendung sind Gerhard Delling und Günter Netzer. Sie stehen nebeneinander an einem pultartigen Tisch, sodass nur ihre Oberkörper für die Fernsehzuschauer zu sehen sind. Nach Spielende bewerten Delling und Netzer zunächst kurz das Spiel bzw. die Leistung der deutschen Nationalmannschaft. Dann folgt eine vorübergehende Live-Schaltung nach Reykjavik, wo ARD-Moderator Waldemar Hartmann DFB-Teamchef Rudi Völler zum Spiel interviewt. Die beiden sitzen leicht zugewandt nebeneinander auf zwei Stühlen. Mimik und Gestik der Sprecher werden nur ansatzweise im Transkript angedeutet - und zwar in einer nonverbalen Spur, die keinem der vier Sprecher zugeordnet ist. (Bereits die Videoaufnahme enthält nur unvollständige Informationen, da die Kameraeinstellungen häufig wechseln und teilweise nur Bildausschnitte zu sehen sind.) Folgende Abkürzungen werden verwendet: LA= linker Arm, RA= rechter Arm, LH= linke Hand, RH= rechte Hand, KO= Kopf, OK= Oberkörper. Waldemar Hartmann hält in der linken Hand ein Mikrophon und benutzt die folglich die rechte zum Gestikulieren. Er bleibt während des gesamten Gesprächs RV zugewandt. Rudi Völler hält in der rechten Hand ein Mikrophon und benutzt folglich die linke zum Gestikulieren. Auffällig ist, dass er seine linke Hand sehr häufig für einen Moment an seine Brust bzw. sein Herz hält. Beinahe während des gesamten Gesprächs mit Waldemar Hartmann wandern Blick, Sprechrichtung und Gestik von Rudi Völler immer wieder an einen für den Fernsehzuschauer unsichtbaren Punkt im Studio. Aus seinen Äußerungen lässt sich schließen, dass es sich bei diesem Bezugspunkt einen Monitor handelt, auf dem Gerhard Delling und Günter Netzer zu sehen sind.</comment><transcription-convention>HIAT (simplified)</transcription-convention></meta-information><speakertable><speaker id="SPK0">
