<ud-information attribute-name="COMA-Speaker-ID">IDF262DC9E-2227-CE09-F7EC-1FD417FF5B23</ud-information><ud-information attribute-name="Pseudo">WH</ud-information><ud-information attribute-name="s:Name">Hartmann</ud-information><ud-information attribute-name="s:Vorname">Waldemar</ud-information><ud-information attribute-name="s:Funktion">Fernsehmoderator, Sport</ud-information><ud-information attribute-name="s:Ausbildung: schulisch">Fachoberschulreife (mittlere Reife) 1965</ud-information><ud-information attribute-name="s:Ausbildung: beruflich">Volontär bei der "Schwäbischen Neuen Presse"</ud-information><ud-information attribute-name="s:Beruf">Sportjournalist seit 1970</ud-information><ud-information attribute-name="s:Familie">Verheiratet (zum dritten Mal), zwei Kinder.</ud-information><ud-information attribute-name="s:Hobbies">Golf, Tennis und Skilauf</ud-information><ud-information attribute-name="s:Ausgeübte Berufe">Wirt in Augsburg Anfang der 70er Jahre.</ud-information></ud-speaker-information>
<comment>Waldemar Hartmann hält in der linken Hand ein Mikrophon und benutzt die folglich die rechte zum Gestikulieren. Er bleibt während des gesamten Gesprächs RV zugewandt. </comment>
</speaker>
