<ud-speaker-information>
<ud-information attribute-name="COMA-Speaker-ID">ID7A53EAFD-8F23-75D9-2FF0-6BCAC44E6A5C</ud-information><ud-information attribute-name="Pseudo">RV</ud-information><ud-information attribute-name="s:Name">Völler</ud-information><ud-information attribute-name="s:Vorname">Rudolf</ud-information><ud-information attribute-name="s:Funktion">Gast bei Waldemar Hartmann (WH) im ARD-Studio nach 0:0 gegen Island.</ud-information><ud-information attribute-name="s:Beruf">Teamchef der Fußballnationalmannschaft seit 2000</ud-information><ud-information attribute-name="s:Beruf des Vaters">Gelernter Dreher, auch Arbeit als Lagermeister,  Jugendbetreuer beim TSV Hanau 1860 (Fußballverein).</ud-information><ud-information attribute-name="s:Beruf der Mutter">Arbeit als Näherin und Putzfrau</ud-information><ud-information attribute-name="s:Ausbildung: beruflich">Bürokaufmann, spielte seit dem 8. Lebensjahr Fußball</ud-information><ud-information attribute-name="s:Familie">Drei Brüder. Seit 1995 in zweiter Ehe, mit einer Italienerin, drei Söhne, zwei Töchter.</ud-information><ud-information attribute-name="s:Ausbildung: schulisch">Realschule</ud-information><ud-information attribute-name="s:Ausgeübte Berufe">bis 1996 Profesioneller Fußballspieler in Kickers Offenbach (1977-1980),TSV 1860 München (1980-1982), Werder Bremen (1982-1987), AS Rom (1987-1992), Olympique Marseille (1992-1994), Bayer 04 Leverkusen (1994-1996). </ud-information></ud-speaker-information>
<comment>Rudi Völler spricht mit leichtem hessischen Akzent (insbesondere hörbar bei den s-, ch- und sch-Lauten). Bsp.: "Die sisch wirklisch" statt "Die sich wirklich".     //     Nachdem Rudi Völler die Kritik der Fernsehmoderatoren zunächst sehr sachlich, souverän und ruhig aufgenommen hat, gerät er relativ plötzlich immer mehr in Rage (etwa ab 00:02:40). Der Tonfall ist fortan beinahe durchgängig mindestens verärgert, phasenweise sogar sehr aggressiv, und geht mit einer entsprechend provokativen Wortwahl einher. Die Äußerungen schwanken zwischen Sprechen und Schreien, allerdings ohne dass er dabei unverhältnismäßig laut wird. Seine ohnehin schon recht beachtliche Sprechgeschwindigkeit wird hingegen mit zunehmender Verärgerung noch höher.     //      Rudi Völler hält in der rechten Hand ein Mikrophon und benutzt folglich die linke zum Gestikulieren. Auffällig ist, dass er seine linke Hand sehr häufig für einen Moment an seine Brust bzw. sein Herz hält. Beinahe während des gesamten Gesprächs mit Waldemar Hartmann wandern Blick, Sprechrichtung und Gestik von Rudi Völler immer wieder an einen für den Fernsehzuschauer unsichtbaren Punkt im Studio. Aus seinen Äußerungen lässt sich schließen, dass es sich bei diesem Bezugspunkt einen Monitor handelt, auf dem Gerhard Delling und Günter Netzer zu sehen sind.</comment>
</speaker>
</speakertable></head>
