.TIE1.2">nicht</ts><nts n="HIAT:ip" id="Seg_927"><![CDATA[ ]]></nts><ts n="HIAT:w" id="Seg_929" s="T146.TIE1.2" e="T147">gemacht</ts><nts n="HIAT:ip" id="Seg_930">?</nts><nts n="HIAT:ip" id="Seg_931"><![CDATA[ ]]></nts></ts></ts></segmentation><segmentation name="SpeakerContribution_Event" tierref="TIE1"><ts n="sc" id="Seg_932" s="T35" e="T37"><ts n="e" id="Seg_934" s="T35" e="T36">• • </ts><ts n="e" id="Seg_936" s="T36" e="T37">Rudi, darf ich zu dem Spiel heute noch mal zurückkommen? </ts></ts><ts n="sc" id="Seg_937" s="T38" e="T50"><ts n="e" id="Seg_939" s="T38" e="T39">Okay. </ts><ts n="e" id="Seg_941" s="T39" e="T40">• </ts><ts n="e" id="Seg_943" s="T40" e="T41">((atmet ein)) </ts><ts n="e" id="Seg_945" s="T41" e="T42">Äh da is ne isländische Mannschaft. </ts><ts n="e" id="Seg_947" s="T42" e="T43">• </ts><ts n="e" id="Seg_949" s="T43" e="T44">Äh die meisten Spieler spielen in England in der zweiten äh Division, sind da auch nicht Stammspieler. </ts><ts n="e" id="Seg_951" s="T44" e="T45">Wir müssten doch eigentlich von der Position her, die wir haben, von den Be</ts><ts n="e" id="Seg_953" s="T45" e="T46">setzungen, </ts><ts n="e" id="Seg_955" s="T46" e="T47">die wir hier haben, </ts><ts n="e" id="Seg_957" s="T47" e="T48">((atmet ein)) die Mannschaft klar beherrschen. </ts><ts n="e" id="Seg_959" s="T48" e="T49">Das ham wir </ts><ts n="e" id="Seg_961" s="T49" e="T50">nicht! </ts></ts><ts n="sc" id="Seg_962" s="T59" e="T60"><ts n="e" id="Seg_964" s="T59" e="T60">Jà. </ts></ts><ts n="sc" id="Seg_965" s="T61" e="T63"><ts n="e" id="Seg_967" s="T61" e="T62">• </ts><ts n="e" id="Seg_969" s="T62" e="T63">Jà. </ts></ts><ts n="sc" id="Seg_970" s="T64" e="T65"><ts n="e" id="Seg_972" s="T64" e="T65">Richtig. </ts></ts><ts n="sc" id="Seg_973" s="T66" e="T67"><ts n="e" id="Seg_975" s="T66" e="T67">(Haben viel)… </ts></ts><ts n="sc" id="Seg_976" s="T70" e="T75"><ts n="e" id="Seg_978" s="T70" e="T71">Nee, ich hab </ts><ts n="e" id="Seg_980" s="T71" e="T72">gedacht: </ts><ts n="e" id="Seg_982" s="T72" e="T73">in der einzelnen Position, wenn ich </ts><ts n="e" id="Seg_984" s="T73" e="T74">eins zu </ts><ts n="e" id="Seg_986" s="T74" e="T75">eins vergleiche… </ts></ts><ts n="sc" id="Seg_987" s="T77" e="T78"><ts n="e" id="Seg_989" s="T77" e="T78">Jà˙ </ts></ts><ts n="sc" id="Seg_990" s="T81" e="T82"><ts n="e" id="Seg_992" s="T81" e="T82">Jà˙ </ts></ts><ts n="sc" id="Seg_993" s="T104" e="T114"><ts n="e" id="Seg_995" s="T104" e="T105">• • • </ts><ts n="e" id="Seg_997" s="T105" e="T106">Also, ich komm noch mal zu/ auf des zurück. </ts><ts n="e" id="Seg_999" s="T106" e="T107">Ich schau mir das auch das Spiel an. </ts><ts n="e" id="Seg_1001" s="T107" e="T108">Und wir sind uns ja meistens in der Beurteilung dieser Spiele auch einig. </ts><ts n="e" id="Seg_1003" s="T108" e="T109">((atmet ein)) </ts><ts n="e" id="Seg_1005" s="T109" e="T110">Äh • i/ ich kann jetzt nicht verstehen, warum die </ts><ts n="e" id="Seg_1007" s="T110" e="T111">Schär</ts><ts n="e" id="Seg_1009" s="T111" e="T112">fe reinkommt, wa</ts><ts n="e" id="Seg_1011" s="T112" e="T113">rum </ts><ts n="e" id="Seg_1013" s="T113" e="T114">ich… </ts></ts><ts n="sc" id="Seg_1014" s="T117" e="T147"><ts n="e" id="Seg_1016" s="T117" e="T118">Jà </ts><ts n="e" id="Seg_1018" s="T118" e="T119">äh ich hab doch keine </ts><ts n="e" id="Seg_1020" s="T119" e="T120">Schär</ts><ts n="e" id="Seg_1022" s="T120" e="T121">fe jetzt da rei</ts><ts n="e" id="Seg_1024" s="T121" e="T122">nge</ts><ts n="e" id="Seg_1026" s="T122" e="T123">bracht. </ts><ts n="e" id="Seg_1028" s="T123" e="T124">(Also) ganz </ts><ts n="e" id="Seg_1030" s="T124" e="T125">ehrlich. </ts><ts n="e" id="Seg_1032" s="T125" e="T126">((lacht in Intervallen,3s))˙ </ts><ts n="e" id="Seg_1034" s="T126" e="T128">((lacht in Intervallen,1,8s))˙ </ts><ts n="e" id="Seg_1036" s="T128" e="T129">((atmet ein)) </ts><ts n="e" id="Seg_1038" s="T129" e="T130">Also in Island gibt es kein Weizenbier zu meinem… </ts><ts n="e" id="Seg_1040" s="T130" e="T131">Äh äh muss ich ganz ehrlich sagen, ((atmet ein)) äh m ich bin auch kein Weizenbiertrinker. </ts><ts n="e" id="Seg_1042" s="T131" e="T132">Ich weiß auch nicht, ob wir jetzt • mit dem Stil weitermachen wollen. </ts><ts n="e" id="Seg_1044" s="T132" e="T133">((atmet ein)) Äh du hast es ja gesagt: Jetzt </ts><ts n="e" id="Seg_1046" s="T133" e="T134">sim</ts><ts n="e" id="Seg_1048" s="T134" e="T135">mer nämlich schon da, • wo wir waren. </ts><ts n="e" id="Seg_1050" s="T135" e="T136">Äh warum sollen mer nicht zu dem (Punkt) kommen, zu äh/ wo ma schon lange sind? </ts><ts n="e" id="Seg_1052" s="T136" e="T137">((atmet ein)) </ts><ts n="e" id="Seg_1054" s="T137" e="T138">Äh˙ • am Mittwoch müssen die da sein, • die sich • • den </ts><ts n="e" id="Seg_1056" s="T138" e="T139">Arsch aufreißen. </ts><ts n="e" id="Seg_1058" s="T139" e="T140">((atmet ein)) </ts><ts n="e" id="Seg_1060" s="T140" e="T141">• • • </ts><ts n="e" id="Seg_1062" s="T141" e="T142">Sitzen die auf der Bank oder sind die heute schon auf dem Feld ge</ts><ts n="e" id="Seg_1064" s="T142" e="T143">we</ts><ts n="e" id="Seg_1066" s="T143" e="T144">sen? </ts><ts n="e" id="Seg_1068" s="T144" e="T145">Und warum haben sie s </ts><ts n="e" id="Seg_1070" s="T145" e="T146">heu</ts><ts n="e" id="Seg_1072" s="T146" e="T147">te nicht gemacht? </ts></ts></segmentation><annotation name="sup" tierref="TIE0"><ta id="Seg_1073" s="T71" e="T75">laut</ta><ta id="Seg_1074" s="T113" e="T114">lauter </ta><ta id="Seg_1075" s="T126" e="T128">lauter </ta></annotation><annotation name="akz" tierref="TIE2"><ta id="Seg_1076" s="T45" e="T46">—</ta><ta id="Seg_1077" s="T49" e="T50">—</ta><ta id="Seg_1078" s="T110" e="T111">—</ta><ta id="Seg_1079" s="T119" e="T120">—</ta><ta id="Seg_1080" s="T133" e="T134">—</ta><ta id="Seg_1081" s="T142" e="T143">—</ta><ta id="Seg_1082" s="T145" e="T146">—</ta></annotation><annotation name="en" tierref="TIE3"><ta id="Seg_1083" s="T35" e="T36">• • </ta><ta id="Seg_1084" s="T36" e="T37">Rudi, can I return to the game again? </ta><ta id="Seg_1085" s="T38" e="T39">Okay. </ta><ta id="Seg_1086" s="T39" e="T40">• </ta><ta id="Seg_1087" s="T40" e="T41">((breathes in)) </ta><ta id="Seg_1088" s="T41" e="T42">So, there is this Icelandic Team. </ta><ta id="Seg_1089" s="T42" e="T43">• </ta><ta id="Seg_1090" s="T43" e="T44">Most of the players are playing in the second division in England, and even there, they're not starters. </ta><ta id="Seg_1091" s="T44" e="T47">We should then, considering our position, considering our line-up, </ta><ta id="Seg_1092" s="T47" e="T48">((breathes in)) clearly outplay this team. </ta><ta id="Seg_1093" s="T48" e="T50">Which we didn't! </ta><ta id="Seg_1094" s="T59" e="T60">Yes. </ta><ta id="Seg_1095" s="T61" e="T62">• </ta><ta id="Seg_1096" s="T62" e="T63">Yes. </ta><ta id="Seg_1097" s="T64" e="T65">That's right. </ta><ta id="Seg_1098" s="T66" e="T67">(Have a lot of)… </ta><ta id="Seg_1099" s="T70" e="T72">No, I was just thinking: </ta><ta id="Seg_1100" s="T72" e="T75">For each position, if I compare them one-to-one… </ta><ta id="Seg_1101" s="T77" e="T78">Yes. </ta><ta id="Seg_1102" s="T81" e="T82">Yes. </ta><ta id="Seg_1103" s="T104" e="T105">• • • </ta><ta id="Seg_1104" s="T105" e="T106">Well, I'm getting back to that. </ta><ta id="Seg_1105" s="T106" e="T107">I watch the game too. </ta><ta id="Seg_1106" s="T107" e="T108">And we most often agree on how to evaluate these games. </ta><ta id="Seg_1107" s="T108" e="T109">((breathes in)) </ta><ta id="Seg_1108" s="T109" e="T114">I don't really know, how this got so tense all of a sudden, why I… </ta><ta id="Seg_1109" s="T117" e="T123">Well I really didn't make this tense. </ta><ta id="Seg_1110" s="T123" e="T125">(Well), (honestly now). </ta><ta id="Seg_1111" s="T125" e="T126">((laughs with interruptions,3s))˙ </ta><ta id="Seg_1112" s="T126" e="T128">((laughs with interruptions,1,8s))˙ </ta><ta id="Seg_1113" s="T128" e="T129">((breathes in)) </ta><ta id="Seg_1114" s="T129" e="T130">Now, there is no wheat beer in Iceland as far as I… </ta><ta id="Seg_1115" s="T130" e="T131">Eh eh, to tell the truth, ((breathes in)) I'm not a wheat beer drinker. </ta><ta id="Seg_1116" s="T131" e="T132">And I don't know if he's going to go on like this. </ta><ta id="Seg_1117" s="T132" e="T135">((breathes in)) Well you said it: Cause now we're there, where we were. </ta><ta id="Seg_1118" s="T135" e="T136">Why don't we get to the (point) where we've been for quite some time? </ta><ta id="Seg_1119" s="T136" e="T137">((breathes in)) </ta><ta id="Seg_1120" s="T137" e="T139">Eh˙ • wednesday those who are working their asses off have to be there. </ta><ta id="Seg_1121" s="T139" e="T140">((breathes in)) </ta><ta id="Seg_1122" s="T140" e="T141">• • • </ta><ta id="Seg_1123" s="T141" e="T144">Are they sitting on the bench or were they on the field today? </ta><ta id="Seg_1124" s="T144" e="T147">And why didn't they do it today? </ta></annotation><annotation name="k" tierref="TIE10"><ta id="Seg_1125" s="T36" e="T37">betont ruhig und sachlich </ta><ta id="Seg_1126" s="T38" e="T50">betont ruhig und sachlich </ta><ta id="Seg_1127" s="T105" e="T113">betont ruhig </ta></annotation></segmented-tier><segmented-tier id="TIE4" speaker="SPK0" category="nv" type="d" display-name="WH [nv]"><segmentation name="Event" tierref="TIE4"><ats n="e" id="Seg_1128" s="T38" e="T42">lächelt kurz</ats><ats n="e" id="Seg_1129" s="T71" e="T75">beugt OK zu RV nach vorn, gestikulieret mit RA </ats><ats n="e" id="Seg_1130" s="T75" e="T76">lehnt sich wieder zurück </ats><ats n="e" id="Seg_1131" s="T76" e="T79">nickt im Folgenden mehrfach deutlich </ats><ats n="e" id="Seg_1132" s="T111" e="T116">legt RH für einen Moment an seine Brust </ats><ats n="e" id="Seg_1133" s="T126" e="T128">lehnt OK beim Lachen nach hinten </ats><ats n="e" id="Seg_1134" s="T133" e="T136">weist mit RH in Richtung RV </ats></segmentation></segmented-tier><segmented-tier id="TIE6" speaker="SPK1" category="v" type="t" display-name="RV [v]"><timeline-fork start="T0" 