="T126.TIE6.2" e="T126.TIE6.3">schön</ts><nts n="HIAT:ip" id="Seg_2322"><![CDATA[ ]]></nts><ts n="HIAT:w" id="Seg_2324" s="T126.TIE6.3" e="T127">locker</ts><nts n="HIAT:ip" id="Seg_2325">.</nts><nts n="HIAT:ip" id="Seg_2326"><![CDATA[ ]]></nts></ts></ts></segmentation><segmentation name="SpeakerContribution_Event" tierref="TIE6"><ts n="sc" id="Seg_2327" s="T0" e="T35"><ts n="e" id="Seg_2329" s="T0" e="T1">(Wie)/ Ich kann s mich nur wiederholen: </ts><ts n="e" id="Seg_2331" s="T1" e="T2">• • </ts><ts n="e" id="Seg_2333" s="T2" e="T3">die Geschichte mit diesem Tiefpunkt. </ts><ts n="e" id="Seg_2335" s="T3" e="T4">Und </ts><ts n="e" id="Seg_2337" s="T4" e="T5">noch </ts><ts n="e" id="Seg_2339" s="T5" e="T6">mal tiefer. </ts><ts n="e" id="Seg_2341" s="T6" e="T7">• • </ts><ts n="e" id="Seg_2343" s="T7" e="T8">Natürlich! </ts><ts n="e" id="Seg_2345" s="T8" e="T9">Wir ham heute… </ts><ts n="e" id="Seg_2347" s="T9" e="T10">• • </ts><ts n="e" id="Seg_2349" s="T10" e="T11">Und da hat der Sebastian Kehl… </ts><ts n="e" id="Seg_2351" s="T11" e="T12">Wir ham • gerecht/ </ts><ts n="e" id="Seg_2353" s="T12" e="T13">Wir ham heute beim Tabellenführer gespielt. </ts><ts n="e" id="Seg_2355" s="T13" e="T14">Wir ham null null gespielt. </ts><ts n="e" id="Seg_2357" s="T14" e="T15">Das is sicherlich (nich) in Ordnung. </ts><ts n="e" id="Seg_2359" s="T15" e="T16">Das is n Tick zu wenig — für </ts><ts n="e" id="Seg_2361" s="T16" e="T17">un</ts><ts n="e" id="Seg_2363" s="T17" e="T18">sere Ansprüche. </ts><ts n="e" id="Seg_2365" s="T18" e="T19">• • </ts><ts n="e" id="Seg_2367" s="T19" e="T20">Wir sind Vize-Weltmeister, das muss n bisschen mehr kommen. </ts><ts n="e" id="Seg_2369" s="T20" e="T21">• • </ts><ts n="e" id="Seg_2371" s="T21" e="T22">Aber diesen Scheiß, </ts><ts n="e" id="Seg_2373" s="T22" e="T23">• • </ts><ts n="e" id="Seg_2375" s="T23" e="T24">der da immer gelabert wird! </ts><ts n="e" id="Seg_2377" s="T24" e="T25">• </ts><ts n="e" id="Seg_2379" s="T25" e="T26">Da sollten sich alle mal wirklich mal Gedanken machen, ob das/ • ob wir in der Zukunft so weitermachen können! </ts><ts n="e" id="Seg_2381" s="T26" e="T27">• • </ts><ts n="e" id="Seg_2383" s="T27" e="T28">Immer </ts><ts n="e" id="Seg_2385" s="T28" e="T29">diese, diese, diese </ts><ts n="e" id="Seg_2387" s="T29" e="T30">Geschichte, alles in, in den Dreck ziehen, alles runter zu ziehen! </ts><ts n="e" id="Seg_2389" s="T30" e="T31">• </ts><ts n="e" id="Seg_2391" s="T31" e="T32">Das ist das Allerletzte! </ts><ts n="e" id="Seg_2393" s="T32" e="T33">• </ts><ts n="e" id="Seg_2395" s="T33" e="T34">Und ich lass mir das nicht mehr so lange gefallen. </ts><ts n="e" id="Seg_2397" s="T34" e="T35">Das sage ich euch ganz ehrlich. </ts></ts><ts n="sc" id="Seg_2398" s="T37" e="T38"><ts n="e" id="Seg_2400" s="T37" e="T38">Jà gerne. </ts></ts><ts n="sc" id="Seg_2401" s="T50" e="T61"><ts n="e" id="Seg_2403" s="T50" e="T51">• </ts><ts n="e" id="Seg_2405" s="T51" e="T52">Ach wieso müssen wir denn die Mannschaften klar beherrschen? </ts><ts n="e" id="Seg_2407" s="T52" e="T53">• • </ts><ts n="e" id="Seg_2409" s="T53" e="T54">Wieso wir spielen doch… </ts><ts n="e" id="Seg_2411" s="T54" e="T55">• </ts><ts n="e" id="Seg_2413" s="T55" e="T56">Die Isländer sind Tabellenführer. </ts><ts n="e" id="Seg_2415" s="T56" e="T57">Das </ts><ts n="e" id="Seg_2417" s="T57" e="T58">weißt</ts><ts n="e" id="Seg_2419" s="T58" e="T59"> du, Waldi! </ts><ts n="e" id="Seg_2421" s="T59" e="T60">Oder ni</ts><ts n="e" id="Seg_2423" s="T60" e="T61">cht? </ts></ts><ts n="sc" id="Seg_2424" s="T63" e="T64"><ts n="e" id="Seg_2426" s="T63" e="T64">Sind sie Tabellenführer oder nich? </ts></ts><ts n="sc" id="Seg_2427" s="T65" e="T70"><ts n="e" id="Seg_2429" s="T65" e="T66">Ja also! </ts><ts n="e" id="Seg_2431" s="T66" e="T67">Und da müssen wir </ts><ts n="e" id="Seg_2433" s="T67" e="T68">n Gegner auswärts klar beherrschen? </ts><ts n="e" id="Seg_2435" s="T68" e="T69">• • • </ts><ts n="e" id="Seg_2437" s="T69" e="T70">Wo in welcher Welt leben 