gar </ts><ts n="e" id="Seg_2498" s="T100" e="T101">nicht hingegangen. </ts><ts n="e" id="Seg_2500" s="T101" e="T102">Die haben doch </ts><ts n="e" id="Seg_2502" s="T102" e="T103">Stand</ts><ts n="e" id="Seg_2504" s="T103" e="T104">fußball gespielt früher! </ts></ts><ts n="sc" id="Seg_2505" s="T112" e="T118"><ts n="e" id="Seg_2507" s="T112" e="T113">Die Schärfe </ts><ts n="e" id="Seg_2509" s="T113" e="T114">bringt </ts><ts n="e" id="Seg_2511" s="T114" e="T115">ihr doch rein! </ts><ts n="e" id="Seg_2513" s="T115" e="T116">Müssen wir uns denn alles ge</ts><ts n="e" id="Seg_2515" s="T116" e="T117">fallen </ts><ts n="e" id="Seg_2517" s="T117" e="T118">lassen? </ts></ts><ts n="sc" id="Seg_2518" s="T121" e="T127"><ts n="e" id="Seg_2520" s="T121" e="T122">Jà </ts><ts n="e" id="Seg_2522" s="T122" e="T123">d</ts><ts n="e" id="Seg_2524" s="T123" e="T124">u</ts><ts n="e" id="Seg_2526" s="T124" e="T125"> nich! </ts><ts n="e" id="Seg_2528" s="T125" e="T126">Du sitzt hier • locker bequem hier auf deinem Stuhl, hast drei Weizenbier getrunken, </ts><ts n="e" id="Seg_2530" s="T126" e="T127">• bist schön locker. </ts></ts></segmentation><annotation name="sup" tierref="TIE5"><ta id="Seg_2531" s="T21" e="T22">geschrien</ta><ta id="Seg_2532" s="T27" e="T30">geschrien </ta><ta id="Seg_2533" s="T34" e="T35">leiser </ta><ta id="Seg_2534" s="T37" e="T38">leise </ta><ta id="Seg_2535" s="T51" e="T52">geschrien </ta><ta id="Seg_2536" s="T71" e="T73">schnell</ta><ta id="Seg_2537" s="T73" e="T74">geschrien</ta><ta id="Seg_2538" s="T112" e="T118">geschrien </ta></annotation><annotation name="akz" tierref="TIE7"><ta id="Seg_2539" s="T4" e="T5">—</ta><ta id="Seg_2540" s="T16" e="T17">—</ta><ta id="Seg_2541" s="T57" e="T58">—</ta><ta id="Seg_2542" s="T79" e="T80">—</ta><ta id="Seg_2543" s="T84" e="T85">—</ta><ta id="Seg_2544" s="T89" e="T90">—</ta><ta id="Seg_2545" s="T99" e="T100">—</ta><ta id="Seg_2546" s="T102" e="T103">—</ta><ta id="Seg_2547" s="T116" e="T117">—</ta><ta id="Seg_2548" s="T122" e=